import React,{useState} from "react";
import Logo from "../img/Alogo.svg";

export default function Loginimg() {

    const [showPassword, setShowPassword] = useState(false);

    const handleTogglePassword = () => {
      setShowPassword(!showPassword);
    };
  return (
    <>
      <div className="Logo">
        <div className="side-bar">
          <img src={Logo} width={150} /> <br />
          <form action="">
            <input
              type="text"
              className="Login-input"
              placeholder="Enter user id"
            />
            <div className="form_item">
              <input type="password" placeholder="Password..." className="Login-input" id="password" />
              <i className="fa-solid fa-eye" id="eye" onClick={handleTogglePassword}></i>
              <button>Login</button>
            </div>
          </form>
        </div>
      </div>
    </>
  );
}
